import { sha256 } from 'js-sha256';
import * as $ from 'jquery';

let text = `
    THIS IS DESCRIPTIVE TEXT
    `;

function Hash() {
    const url = 'https://raw.githubusercontent.com/cse442-21f/FP-Blockchain/main/docs/text/helloworld.txt?token=ADHANXTPB7T47FH76USIGLTBT7ZIQ';
    const text = (() => {
        var text = null;
        $.ajax({
            'async': false,
            'url': url,
            'dataType': "json",
            'success': (data) => {
                text = data;
            }
        });
        return text;
    })();
    console.log(text);

    return (
        sha256("Hello World")
    );
}

export default Hash;
